class Walker:
    def __init__(self):
        self.dir = (0, 1)
        self.pos = [1, 1]
        self.dirmap = {}
        self.dirmap['U'] = (0,1)
        self.dirmap['D'] = (0,-1)
        self.dirmap['L'] = (-1,0)
        self.dirmap['R'] = (1,0)
        self.visited = set()
        self.numpadmat= [[7,4,1], [8,5,2], [9,6,3]]

    def go(self, chirality, steps):
        self.dir = self.turnmap[chirality][self.dir]
        for i in range(steps):
            for i in (0, 1):
                self.pos[i] += self.dir[i]
            if tuple(self.pos) in self.visited:
                print("visisted:" + str(self.pos))
            self.visited.add(tuple(self.pos))

    def goDir(self, sdir):
        dir = self.dirmap[sdir]
        for i in (0,1):
            self.pos[i] += dir[i]
            self.pos[i] = max(min(self.pos[i],2),0)

    def numpad(self):
        return self.numpadmat[self.pos[0]][self.pos[1]]

    def __repr__(self):
        return str([self.dir, self.pos])

fred = Walker()

instructions = ["",
"",
"",
"",
""
]
for instruction in instructions:
    for i in instruction:
        fred.goDir(i)
    print(fred.numpad())
